import React from "react";
import Button from "@mui/material/Button";

interface ButtonProps {
	name: string;
}

const Greeting: React.FC<GreetingProps> = ({ name }) => {
	<div>
		<Button
			variant="contained"
			color="primary"
			onClick={() => alert("クリックされました")}
		>
			ボタン
		</Button>
	</div>;
	return <h1>Hello, {name}!</h1>;
};

export default App;
